import React, { useState } from "react";
import classes from "./Table.module.css"

const Table = () => {
    let defaultMargin=230;
    let marginStep=10;

    const [margin, setMargin] = useState(defaultMargin);

    const changeMargin = () => {
        setMargin(margin + marginStep);

        document.getElementById('YouDiv').style.top=({margin}.toString + 'px');
    }

    return(
        <div className={classes.table}>
            <div id='YouDiv' className={classes.item2}>Text</div>
            <div className={classes.item1}>Text</div>
            <button onClick={changeMargin}>Click me</button>
        </div>
    )
}

export default Table;
